import React from "react"
import { motion } from "framer-motion/dist/framer-motion";

const About = () => {
  return (
    <motion.div

      initial = {{opacity: 0}}
      animate = {{opacity: 1}}
      exit = {{opacity: 0}}>
    </motion.div>
  )
}

export default About
